function rot13(str)  {
  let decodificado = "";
  for (let i = 0; i < str.length; i++) {
    let char = str[i];
    if (char.match(/[A-Z]/)) {
      let charCode = char.charCodeAt(0);
      charCode += 13;
      if (charCode > 90) {
        charCode -= 26;
      }
      decodificado += String.fromCharCode(charCode);
    } else {
      decodificado += char;
    }
  }
  return decodificado;
}

